This JSON object represents a drone simulation environment in a dense forest area with varying terrain, including hills and valleys. The wind speed is 15 m/s, causing turbulence and affecting flight stability. The temperature is 10°C, potentially affecting battery performance. The lighting conditions are overcast, requiring reliance on onboard sensors. The GPS signal quality is moderate, with occasional signal loss due to tree cover. The altitude varies from 50 meters to 150 meters, requiring altitude adjustments. Obstacles include trees and uneven terrain, posing potential collision risks. The network/communication quality is weak in areas with dense tree cover.

The sUAS configuration and properties include GPS, thermal camera, and acoustic sensors. The payload weight is 2.5 kg, including rescue equipment and sensors. The battery life is 40 minutes per flight, requiring efficient planning for search patterns and recharging logistics. The sUAS properties to be tested include maneuverability, durability, stability in low light, and communication range.

